import React from 'react';
import Index from "./views/index/index"
import { Route, Switch } from 'react-router-dom';
import {router} from "./router/index"
function App() {
return (
	<div className="App">
		<Switch>
			{router.map((item,index)=>{
				return (
					<Route 
						to={item.path}
						render={()=>{
							return item.render()
						}}
						key={item.path}
						exact={item.exact}
					></Route>
				)
			})}
		</Switch>
	</div>
  );
}
export default App;
